window.bookSummaryJSON = "<p>After 10 years and 13 adventures, at last the triumphant conclusion to Kim Harrison's number-one <i>New York Times</i> best-selling Hollows series! </p> <p>In 2004, Kim Harrison made her debut with <i>Dead Witch Walking</i>, an electrifying urban audiobook novel full of action, mystery, romance, and humor, which introduced bounty hunter and witch Rachel Morgan. Over the course of 12 books, Rachel confronted numerous threats, vanquished a range of cunning and powerful enemies, risked her heart, suffered haunting loss, and nearly lost her life. Now, in <i>The Witch with No Name</i>, Kim Harrison brings back her wildly popular heroine for one final, epic battle. </p> <p>Rachel Morgan's come a long way from the klutzy runner fleeing a bad job. She's faced vampires and werewolves, banshees, witches, and soul-eating demons. She's crossed worlds, channeled gods, and accepted her place as a day-walking demon. She's lost friends and lovers and family, and an old enemy has become something much more. </p> <p>But power demands responsibility, and world-changers must always pay a price. </p> <p>That time is now. </p> <p>To save her best friend's soul and the rest of the living vampires, to keep the demonic ever-after and our own world from utter destruction at the hands of fanatics, Rachel Morgan will risk everything.</p>"; 
